import { css } from '@emotion/css'

export const adminSelectable = css `
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 20px;
  padding: 10px;
  border-radius: 20px;
  border: 2px solid rgb(230, 227, 227);
  box-shadow: 1px 1px 1px 1px rgb(230, 227, 227);
`;

export const adminOptionImage = css `
  width: 300px;
  height: 300px;
`;
